/* Da el formato a cada tabla */
function create_table(a_body, some_widths){
	return {
		headerRows: 1,
		alignment: 'center',
		widths: some_widths,

		body: a_body
		};
}

/* Da el formato a cada fila */
function create_row(a_text, content){
	var row = [{text:a_text, style:'header'}];
	for (col = 0; col < content.length; col++){
		row.push({text:content[col], style:'entable'});
	}
	return row
}

/* Falta completar los datos, quizás hay que importar
algunos datos desde el portal, aprovechando que se logea
desde allá. Ver un certificado entregado por la universidad */
function Download(data, username){

	/* Contenido base:
	* Información del alumno
	*/
	var main_content = [
		{
			image: 'encabezado',
			width: 440,
			absolutePosition : { x :35,y :20 }
		},

		{text:'Ficha Académica Acumulada', style:'title'},
		' ',  

		{text:'INFORMACION DEL ALUMNO', style:'header'},
		' ',  
		    
		{table: {
			widths: [ '*', '*', '*', '*' ],
		    headerRows: 1,
		        
		    body: [
		    	[
		    		{ text: 'Alumno: ' + data.Datos[1], style: 'header', alignment:'left', colSpan: 2 }, 
		            {}, 
		            { text: 'Rut: ' + data.Datos[0], style: 'header', alignment:'left', colSpan:2 }, 
		            {}],
		        [
		        	{ text: 'Carrera: ' + data.Carrera, style: 'curso', colSpan:2 }, 
		            {}, 
		            { text: 'Escuela: ' + data.Escuela, style: 'curso' },
		            { text: 'Programa: ' + data.Programa, style: 'curso' }]
		        ]
		    }
		}
	];

	main_content.push(' ');
	main_content.push({text:'CREDITO DE INSTITUCION', style:'header'});	

	/* Iteracion sobre los semestres cursados */
	for (sem = 0; sem < data.Semestres.length; sem++){
		/* Key del diccionario de semestres, i.e, el semestre sobre el que se itera */
		var semestre_actual = Object.keys(data.Semestres[sem]);

		/* Tabla 1: Cursos correspondiente al 'semestre_actual' */
		var new_body = [
			[ { text:'Materia', style: 'header'} , {text:'Curso', style:'header'}
			, {text:'Nivel', style:'header'}, {text:'Título', style:'header'}
			, {text:'Calificación', style:'header'}, {text:'Horas crédito', style:'header'}
			, {text:'Puntos de calidad', style:'header'}, {text:'R', style:'header'}
			]
		];
		for (i = 0; i < data.Semestres[sem][semestre_actual].length; i++){
			new_body.push([
				{text:data.Semestres[sem][semestre_actual][i][0], style: 'entable'}, 
				{text:data.Semestres[sem][semestre_actual][i][1], style:'entable'},
				{text:data.Semestres[sem][semestre_actual][i][2], style:'entable'}, 
				{text:data.Semestres[sem][semestre_actual][i][3], style:'curso'},
				{text:data.Semestres[sem][semestre_actual][i][4], style:'entable'}, 
				{text:data.Semestres[sem][semestre_actual][i][5], style:'entable'},
				{text:data.Semestres[sem][semestre_actual][i][6], style:'entable'}, 
				{text:data.Semestres[sem][semestre_actual][i][7], style:'entable'}
				]);
		}
		var new_table = create_table(new_body, [ 30, 30, 30, '*', 'auto', 'auto', 'auto', 'auto']);

		/* Tabla 2: Créditos del semestre y acumulados hasta el 'semestre_actual' */
		var second_body = [
			[ { text:' '} , {text:'Horas Intentadas', style:'header'}
			, {text:'Horas Pasadas', style:'header'}, {text:'Horas Ganadas', style:'header'}
			, {text:'Horas PGA', style:'header'}, {text:'Puntos de Calidad', style:'header'}
			, {text:'PGA', style:'header'}
			]
		];
		second_body.push(create_row('Periodo Actual:', data.Totales_periodo[semestre_actual]));
		second_body.push(create_row('Acumulativo:', data.Totales_acumulado[semestre_actual]));
		var second_table = create_table(second_body, [ '*', 50, 50, 50, 50, 50, 50]);

		/* Se agrega el contenido creado al contenido que será plasmado en el pdf 
		* "Semestre actual"
		* Tabla 1: Cursos
		* "Totales periodo"
		* Tabla 2: Resumen
		*/
		main_content.push(' ');
		main_content.push({text: semestre_actual, style: 'header'});
		main_content.push({table: new_table});
		main_content.push(' ');
		main_content.push({text: 'Totales periodo', style: 'header'});
		main_content.push({table: second_table});
		main_content.push(' ');
	}	
	
	/* Tabla: Resumen completo de creditaje */
	var third_body = [
		[ { text:' '} , {text:'Horas Intentadas', style:'header'}
		, {text:'Horas Pasadas', style:'header'}, {text:'Horas Ganadas', style:'header'}
		, {text:'Horas PGA', style:'header'}, {text:'Puntos de Calidad', style:'header'}
		, {text:'PGA', style:'header'}
		]
	];
	third_body.push(create_row('Total institución:', data.Totales_hist_acad["Total Institución"]));
	third_body.push(create_row('Total transferido:', data.Totales_hist_acad["Total Transferido"]));
	third_body.push(create_row('Global:', data.Totales_hist_acad["Global"]));
	var third_table = create_table(third_body, [ '*', 50, 50, 50, 50, 50, 50]);

	/* Se agrega el contenido creado al contenido que será plasmado en el pdf
	* "TOTALES HIST ACAD (PREGRADO)"
	* Tabla: Resumen
	*/
	main_content.push(' ');
	main_content.push({text: 'TOTALES HIST ACAD (PREGRADO)', style:'header'});	
	main_content.push(' ');
	main_content.push({table: third_table});
	main_content.push(' ');

	
	/* Se agrega el contenido creado al contenido que será plasmado en el pdf
	* "CURSOS EN PROGRESO"
	*/
	main_content.push({text: 'CURSOS EN PROGRESO', style:'header'});	

	/* Iteración sobre los semestres con cursos pendientes o siendo cursados */
	for (sem = 0; sem < data.Pendientes.length; sem++){
		/* Key del diccionario de semestres, i.e, el semestre sobre el que se itera */
		var semestre_actual = Object.keys(data.Pendientes[sem]);

		/* Tabla: Cursos pendientes en el 'semestre_actual' */
		var new_body = [
			[ { text:'Materia', style: 'header'} , {text:'Curso', style:'header'}
			, {text:'Nivel', style:'header'}, {text:'Título', style:'header'}
			, {text:'Horas crédito', style:'header'}
			]
		];
		for (i = 0; i < data.Pendientes[sem][semestre_actual].length; i++){
			new_body.push([
				{text:data.Pendientes[sem][semestre_actual][i][0], style: 'entable'}, 
				{text:data.Pendientes[sem][semestre_actual][i][1], style:'entable'},
				{text:data.Pendientes[sem][semestre_actual][i][2], style:'entable'}, 
				{text:data.Pendientes[sem][semestre_actual][i][3], style:'curso'},
				{text:data.Pendientes[sem][semestre_actual][i][4], style:'entable'}
				]);
		}
		var new_table = create_table(new_body, [ 30, 30, 30, '*', 'auto']);

		/* Se agrega el contenido creado al contenido que será plasmado en el pdf 
		* "Semestre actual"
		* Tabla: Cursos pendientes
		*/
		main_content.push(' ');
		main_content.push({text: semestre_actual, style: 'header'});
		main_content.push({table: new_table});
	}
	
	/* Generacion de la variable final que se convertira en .pdf
	* Background
	* Contenidos
	* Imagenes
	* Estilos
	*/
	var dd = {
		background: function(page) {
			return [
			{
                image: 'fondo',
                width: 368,
                height: 592,
                absolutePosition : {y :100 },
                alignment: 'right'
            },
            '\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n',
            {
                margin: [20, 0, 20, 20],
                table: {
                    headerRows: 0,
                    widths: [ 'auto', '*', 'auto'],
                    body: [
                        [ 
                            {text: 'Este documento impreso no tiene carácter oficial. Fecha de Impresión :' + data.Tiempo,
                            alignment: 'left', style: 'eop'},
                            {text: ' '},
                            {text: 'Pagina - ' + page,
                            alignment: 'right', style: 'eop'}
                            ]
					]
					},
				layout: 'noBorders'
			},
            ]
        },
		content: main_content,
  
    	images: {
			encabezado: 'data:image/png;base64,'    ,	
			fondo: 'data:image/png;base64,'
		},

		styles: {
		    title: {
		      fontSize: 12,
		      bold: true,
		      alignment: 'center',
		      margin: [0, 80, 0, 0]
		    },
		    header: {
		      fontSize: 7,
		      bold: true,
		      alignment: 'center',
		      fillColor: '#D9D9D9'
		    },
		    entable: {
		      fontSize: 7,
		      bold: true,
		      alignment: 'center'
		    },
		    curso: {
		      fontSize: 7,
		      bold: true,
		      alignment: 'left'
		    },
		    eop: {
		        fontSize: 8,
		        italic: true
		    }
		}
	};
	pdfMake.createPdf(dd).download(username + '.pdf');
	}

